import * as React from 'react';
import MenuIcon from "@material-ui/icons/Menu";
import {makeStyles} from "@material-ui/core/styles";
import {AppBar, Box, Toolbar, Typography, IconButton, 
       MenuItem, Menu}from '@material-ui/core';
       import { withRouter }  from "react-router-dom";
import PatientForm from './PatientForm';
import App from './App';

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1
    },
    menuBotton: {
        marginRight: theme.spacing(2)

    }, 

    title: {
        flexGrow: 1
    },
}))
const NavBar = (props) => {

    const {history} = props;
    const classes = useStyles();

  const [anchorEl, setAnchorEl] = React.useState(null);



  const handleMenu = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClick = (pageURL) => {
      history.push(pageURL)
    setAnchorEl(null);
  };

  return (
      <div className={classes.root}>
    <Box sx={{ flexGrow: 1 }}>

    <AppBar position="static">
      <Toolbar>

        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }} className={classes.title}>
       insert logo
        </Typography>

          <div>
          <IconButton
          size="large"
          edge="start"
          color="inherit"
          aria-label="menu"
          className={classes.menuBotton}
          sx={{ mr: 2 }}
          onClick={handleMenu}
        >
          <MenuIcon />
        </IconButton>
            <Menu
              id="menu-appbar"
              anchorEl={anchorEl}
              anchorOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              keepMounted
              transformOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              open={Boolean(anchorEl)}
              onClose={()=>setAnchorEl(null)}
              className={classes.menuBotton}
            >
              <MenuItem onClick={()=>handleMenuClick('/')}>Table</MenuItem>
              <MenuItem onClick={()=>handleMenuClick('patientform')}>Patient</MenuItem>
              <MenuItem onClick={()=>handleMenuClick('treatmentform')}>Treatment</MenuItem>
            </Menu>
          </div>

      </Toolbar>
    </AppBar>
  </Box>
  </div>
  );
}

export default NavBar;
